import React from 'react';

const portfolioItems = [
  {
    title: 'Social Media for Fashion',
    category: 'Social Media',
    imgPlaceholder: 'bg-blue-200',
  },
  {
    title: 'Fitness Coach Website',
    category: 'Web Development',
    imgPlaceholder: 'bg-green-200',
  },
  {
    title: 'Event Management App',
    category: 'App Development',
    imgPlaceholder: 'bg-purple-200',
  },
  {
    title: 'Influencer Reels',
    category: 'Video Editing',
    imgPlaceholder: 'bg-pink-200',
  },
  {
    title: 'E-commerce Ad Campaign',
    category: 'Ad Campaigns',
    imgPlaceholder: 'bg-yellow-200',
  },
  {
    title: 'Tech Startup Website',
    category: 'Web Development',
    imgPlaceholder: 'bg-indigo-200',
  },
];

const PortfolioPage = () => {
  return (
    <div className="container mx-auto py-16 px-4">
      <div className="text-center max-w-3xl mx-auto">
        <h1 className="text-4xl font-bold text-primary mb-4">Our Work</h1>
        <p className="text-lg text-gray-600 mb-12">
          We're proud of what we create. Our work speaks for itself.
        </p>
      </div>

      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
        {portfolioItems.map((item) => (
          <div key={item.title} className="bg-white rounded-lg shadow-lg overflow-hidden group">
            <div className={`h-56 w-full ${item.imgPlaceholder} flex items-center justify-center`}>
              <span className="text-gray-500">Image Placeholder</span>
            </div>
            <div className="p-6">
              <p className="text-sm text-gray-500 mb-1">{item.category}</p>
              <h3 className="text-xl font-bold">{item.title}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PortfolioPage;
